import styled from "./Navbar.module.css"
function Navbar(props){
    return(

      <div className="container">
          <div className={styled.header}>
            {props.title}
            <ul>
                <li>لیست مقالات</li>
                <li>ساخت مقاله</li>
                <li>درباره</li>
            </ul>

        </div>
      </div>
    );
}

export default Navbar
